import React from "react";
import {Link} from "react-router-dom";
const Arizona = () =>{
    return(
        <>
          <Route>
            <Link to="google.com" target="_blank">
            google.com
            </Link>
    </Route>
        <div className="home_page"> 
          <h1>Arizona</h1>
        </div>
       </>
    )
};
export default Arizona;
